import React from 'react'
import { Navbar, Container } from 'react-bootstrap'
export default function MyNavbar() {
  return (
    <Navbar bg="dark">
        <Container>
          <Navbar.Brand>BLOOD BANK MANAGMENT SYSTEM</Navbar.Brand>
        </Container>
    </Navbar>
  )
}
